import React from "react";
import {BurgerIcon} from "@ya.praktikum/react-developer-burger-ui-components";

function ListItems () {
    return(
        <ul>
            <li>
                <BurgerIcon type="primary"/>
                <a>Конструктор</a>
            </li>
            <li>
                <a>Лента заказов</a>
            </li>
        </ul>
    )
}

export default ListItems;
